      var x = longitude - 0.0065;
      var y = latitude - 0.006;
      var z = Math.sqrt(x * x + y * y) - 0.00002 * Math.sin(y * x_pi);
      var wz = Math.atan2(y, x) - 0.000003 * Math.cos(x * x_pi);
      var lon = z * Math.cos(wz);
      var lat = z * Math.sin(wz);
